import React, { useEffect } from 'react';

const ProjetData = () => {

  useEffect(() => {
    const handleResize = (event) => {
      if (event.data['datawrapper-height']) {
        const iframes = document.querySelectorAll('iframe');
        for (const id in event.data['datawrapper-height']) {
          for (let i = 0; i < iframes.length; i++) {
            if (iframes[i].contentWindow === event.source) {
              iframes[i].style.height = event.data['datawrapper-height'][id] + 'px';
            }
          }
        }
      }
    };

    window.addEventListener('message', handleResize);

    return () => {
      window.removeEventListener('message', handleResize);
    };
  }, []);

  return (
    <div>
      <iframe 
        title="House prices in the U.K." 
        aria-label="Lignes multiples" 
        id="datawrapper-chart-RFbPo" 
        src="https://datawrapper.dwcdn.net/RFbPo/1/" 
        scrolling="no" 
        frameBorder="0" 
        style={{ width: '100%', border: 'none' }} 
        height="923" 
        data-external="1"
      ></iframe>
    </div>
  );
}

export default ProjetData;
